import React, { Component } from 'react';
import biologia from '../../images/lunchrooms/biologia.png';

class LunchroomComponent extends Component {
  render() {
    return (
      <div className="LunchroomComponent">
        <div className="col-md-3">
          <div className="thumbnail">
            <img src={ biologia } className="small" alt="biologia"/>
              <div className="caption">
                <h4>{ this.props.name} </h4>
                <p>this.props.txt</p>
              </div>
          </div>
        </div>
      </div>
    );
  }
}

export default LunchroomComponent;
